import React from 'react'
import Person from './Person'
import './myStyles.css'

function NameList(props) {
    // const names = ['Bruce', 'Clark', 'Diana']
    // const nameList = names.map(name => <h2>{name}</h2>)
    // const nameList2 = names.map(name => names)

    let className = this.props.primary ? 'primary' : ''
    const names = ['Bruce', 'Clark', 'Diana', 'Bruce']
    const persons = [
        {
            id: 1,
            name: 'Bruce',
            age: 30,
            skill: 'React'
        },
        {
            id: 2,
            name: 'Clark',
            age: 25,
            skill: 'Angular'
        },
        {
            id: 2,
            name: 'Diana',
            age: 28,
            skill: 'Vue'
        }
    ]
    const nameList = names.map((name, index) => <h2 className={className} key={index}>{index} {name}</h2>)

    return (
        <div>{nameList}</div>
    )
}

export default NameList
